import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.scss';

class App extends Component {
  render() {
    return (
      <div className="wrapper">
        <div className="container">
          <div className="row">
            <div className="col-md-6 offset-md-3">
              hello world
            </div>
          </div>
        </div> 
      </div>
    )
  }
}

export default App;
